import React from 'react';

import SportSeeLogo from '../../assets/icons/sportsee_logo.svg';
import { Link } from 'react-router-dom';
import { useParams } from 'react-router';
import { useContext } from 'react';

import './Header.css';

const Header = () => {
	const { id } = useContext(React.createContext({ id }));
	return (
		<header className="header">
			<div className="header__logo">
				<Link to="/">
					<img src={SportSeeLogo} alt="SportSee Logo" />
				</Link>
			</div>
			<nav>
				<ul className="header__nav">
					<Link to={`/user/${id}`} className="active">
						Accueil
					</Link>
					<Link to={`/user/${id}/profil`} id={id}>
						Profil
					</Link>
					<Link to={`/user/${id}/settings`} id={id}>
						Settings
					</Link>
					<Link to={`/user/${id}/community`} id={id}>
						Communaut√©
					</Link>
				</ul>
			</nav>
		</header>
	);
};

export default Header;
